module.exports = {
  getYukiForRegion,
  getCoverPhotoForRegion,
  getLanguage
}

function getYukiForRegion() {
  let infoPerRegion = getInfoForRegion()
  return infoPerRegion  &&   infoPerRegion.yuki
}
function getCoverPhotoForRegion() {
  let infoPerRegion = getInfoForRegion()
  return infoPerRegion  &&  infoPerRegion.coverPhoto
}
function getLanguage() {
  // debugger
  let lang
  let locales = RNLocalize.getLocales()
  if (locales)
    lang = locales[0].languageCode
  // if (Platform.OS === 'android')
  //   lang = NativeModules.I18nManager.localeIdentifier;
  // else
  //   lang = NativeModules.SettingsManager.settings.AppleLocale;

  if (!lang)
    lang = navigator.language
  return lang.split('-')[0]
}
function getInfoForRegion() {
  let tz = RNLocalize.getTimeZone()
  if (tz)
    return INFO_PER_REGION[tz]  ||  INFO_PER_REGION[tz.split('/')[0]]
  let lang = getLanguage() //DeviceInfo.getDeviceLocale()
  // if (!lang)
  //   lang = navigator.language
  if (!lang)
    return
  lang = lang.toLowerCase()
  for (let cp in INFO_PER_REGION) {
    let info = INFO_PER_REGION[cp]
    if (info.languages  &&  info.languages.indexOf(lang) !== -1)
      return info
  }
}
